import React, { Component } from 'react'
import Chart from './Chart'

const data = {
    title: {
        text: 'My chart'
    },
    series: [{
        name: 'Profits',
        data: [1, 2, 3]
    }]
}

export default () => (
    <Chart data={data} />
)
